function App() {


    const[time,setTime]=useState(new Date().toLocaleDateString());

    const IncNum = () => {
        const date = new Date();
        let currentTime = date.toLocaleTimeString();
        currentTime = date.toLocaleTimeString();
        setTime(currentTime);
    };

    return (
        <>
          <h1>{time}</h1>
          <button onClick={IncNum}>Click Me</button> 
        </>

    );
}

export default App;
